import InnerTile from "./InnerTile"
import "../likeAcordian/Acordian.css"
import { useState } from "react"
const data = [
    { id: 1, title: "A" },
    { id: 2, title: "B" },
    { id: 3, title: "C" },
    { id: 4, title: "D" },
]

function ClassPrac() {
    const [state, setState] = useState(data)
    const clicked = (val) => {

        const filterd = state.filter((item) => item.id !== val.id)
        setState(filterd)
    }
    return (
        <div className="mainBox">
            {state.map((item) => {
                return <InnerTile key={item.id} data={item} clicked={clicked} />
            })}
        </div>
    )
}
export default ClassPrac
